import React, { useState } from "react";
import universityData from "./UniversityData";
import jsPDF from "jspdf";

function App() {
  const [selectedUniversity, setSelectedUniversity] = useState(universityData[0]);

  // ✅ Get all subjects safely
  const subjects = Object.keys(selectedUniversity.subjectDetails);
  const [selectedSubject, setSelectedSubject] = useState(subjects[0]);

  const [selectedProgram, setSelectedProgram] = useState("bachelors");
  const [selectedStudentType, setSelectedStudentType] = useState("international");
  const [cgpa, setCgpa] = useState("");
  const [sat, setSat] = useState("");
  const [savedReports, setSavedReports] = useState([]);

  const selectedSubjectData =
    selectedUniversity.subjectDetails[selectedSubject]?.[selectedProgram];

  const convertCgpaToGpa = (cgpa) => (cgpa / 10) * 4;

  const estimateAdmissionProbability = () => {
    if (!selectedSubjectData || !cgpa || !sat) return "Enter both CGPA and SAT";
    const gpa = convertCgpaToGpa(parseFloat(cgpa));
    const gpaCutoff = parseFloat(selectedSubjectData.gpaCutoff);
    const satCutoff = parseInt(selectedSubjectData.satCutoff);

    if (gpa >= gpaCutoff && sat >= satCutoff) return "Highly Likely";
    if (gpa >= gpaCutoff - 0.2 || sat >= satCutoff - 30) return "Likely";
    if (gpa >= gpaCutoff - 0.5 || sat >= satCutoff - 100) return "Doubtful";
    return "Unlikely";
  };

  const saveReport = () => {
    const report = {
      university: selectedUniversity.name,
      subject: selectedSubject,
      program: selectedProgram,
      gpa: convertCgpaToGpa(parseFloat(cgpa)).toFixed(2),
      sat,
      admissionChance: estimateAdmissionProbability(),
    };
    setSavedReports([...savedReports, report]);
  };

  const downloadPDF = () => {
    const doc = new jsPDF();
    savedReports.forEach((report, index) => {
      doc.text(
        `Report ${index + 1}:
University: ${report.university}
Subject: ${report.subject}
Program: ${report.program}
GPA: ${report.gpa}
SAT: ${report.sat}
Admission Chance: ${report.admissionChance}`,
        10,
        10 + index * 40
      );
    });
    doc.save("admission_report.pdf");
  };

  return (
    <div style={{ padding: "20px" }}>
      <h1>{selectedUniversity.name}</h1>
      <h2>QS World Rank: {selectedUniversity.generalRank}</h2>

      <div>
        <label>Select Subject: </label>
        <select value={selectedSubject} onChange={(e) => setSelectedSubject(e.target.value)}>
          {subjects.map((subject) => (
            <option key={subject} value={subject}>
              {subject}
            </option>
          ))}
        </select>
      </div>

      <div>
        <label>Select Program: </label>
        <select value={selectedProgram} onChange={(e) => setSelectedProgram(e.target.value)}>
          <option value="bachelors">Bachelors</option>
          <option value="masters">Masters</option>
          <option value="phd">PhD</option>
        </select>
      </div>

      <div>
        <label>Student Type: </label>
        <select value={selectedStudentType} onChange={(e) => setSelectedStudentType(e.target.value)}>
          <option value="international">International</option>
          <option value="domestic">Domestic</option>
        </select>
      </div>

      {selectedSubjectData && (
        <>
          <h3>Program Details</h3>
          <p><strong>Start Date:</strong> {selectedSubjectData.intake}</p>
          <p><strong>Fees:</strong> {selectedSubjectData.fees}</p>
          <p><strong>GPA Cutoff:</strong> {selectedSubjectData.gpaCutoff}</p>
          <p><strong>SAT Cutoff:</strong> {selectedSubjectData.satCutoff || "N/A"}</p>
          <p><strong>Eligibility:</strong> {selectedSubjectData.eligibility[selectedStudentType]}</p>
          <p><strong>Course Link:</strong> <a href={selectedSubjectData.courseLink} target="_blank" rel="noreferrer">View Course</a></p>
        </>
      )}

      <div>
        <label>Enter your CGPA (out of 10): </label>
        <input type="number" value={cgpa} onChange={(e) => setCgpa(e.target.value)} />
      </div>

      <div>
        <label>Enter your SAT Score: </label>
        <input type="number" value={sat} onChange={(e) => setSat(e.target.value)} />
      </div>

      <div>
        <strong>Estimated Admission Chance: </strong>
        {estimateAdmissionProbability()}
      </div>

      <button onClick={saveReport}>Save Report</button>
      <button onClick={downloadPDF}>Download PDF</button>

      {savedReports.length > 0 && (
        <div>
          <h3>Saved Reports</h3>
          <ul>
            {savedReports.map((report, index) => (
              <li key={index}>
                {report.university} - {report.subject} ({report.program}) | GPA: {report.gpa}, SAT: {report.sat} ➤ {report.admissionChance}
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default App;
